import React, { Component } from 'react'
import { programs } from './UserFunctions'
import "./Programs.css"

class ProgramsList extends Component {
    constructor() {
        super();
        this.state = {
            programList: [],
        }

    }         
    componentDidMount() {
        console.log('mounted')

        programs().then(res => {

            if(!res.error) {
                this.setState({
                    programList: res.programs
                })
                console.log(this.state.programList)


            } else{
                console.log("error in axios request: apidata")
            }     
        })

    }

    render(){
        const {Â programList } = this.state;
        return (
        <div className="Programs">
            <table>
                <tr>
                    <th>Username</th>
                    <th>Password</th>
                </tr>
                {programList.map(item =>(
                <tr>
                    <td key={item.program}>
                        {item.program} 
                    </td>
                    <td key={item.program}>
                        {item.password} 
                    </td>  
                </tr>
                ))}

            </table>
        </div>
        )
    }
}

export default ProgramsList
